(19, 42, 'tl_article', 128, 1559651805, 'text', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:51:\"Bootstrap theme for creatives and small businesses!\";}', '<p>Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project!</p>\n<ul class=\"mb-0\">\n<li>A modern, flat design layout</li>\n<li>UX friendly navigation with an on scroll style change</li>\n<li>Custom SASS compiled alongside Bootstrap for deeper customization options</li>\n<li>Gulp 4 based development environment with a watch task for rapid custom development</li>\n<li>Intuitive HTML markup with easy to customize content sections</li>\n<li>Responsive, full page header featuring a background image with overlay and vertically centered content</li>\n<li>Fully functional portfolio image grid with hover captions and a working lightbox gallery</li>\n</ul>', '1', 0x90d07d32869c11e9830940b03409e6de, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', NULL, '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', NULL, '', NULL, NULL, 0, 0, '', '', 'none', '', '', '', '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\"