(20, 42, 'tl_article', 64, 1559652217, 'text', 'a:2:{s:4:\"unit\";s:2:\"h2\";s:5:\"value\";s:32:\"Bootstrap theme for creatives...\";}', '<p>Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project!</p>\n<ol>\n<li>A modern, flat design layout</li>\n<li>UX friendly navigation with an on scroll style change</li>\n<li>Custom SASS compiled alongside Bootstrap for deeper customization options</li>\n<li>Gulp 4 based development environment with a watch task for rapid custom development</li>\n<li>Intuitive HTML markup with easy to customize content sections</li>\n<li>Responsive, full page header featuring a background image with overlay and vertically centered content</li>\n<li>Fully functional portfolio image grid with hover captions and a working lightbox gallery</li>\n</ol>\n<p>Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project! Creative is a one page Bootstrap theme for creatives, small businesses, and other multipurpose use. A modern, flat design style works in unison with rich features and plugins making this theme a great boilerplate for your next Bootstrap based project!</p>', '1', 0x90d07d32869c11e9830940b03409e6de, '', '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:0:\"\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', NULL, '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', NULL, '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:\"\";i:1;s:0:\"\";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', NULL, '', NULL, NULL, 0, 0, '', '', 'none', '', '', '', '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1', '1', '', '', '', '', '', '1', '', '', '', 0, '', 0, 0, '0%', 0, '', '', '', '', '', '', '', '', 'rsts_default', 0, '', 0, 'rsts_default'),
(21, 46, 'tl_article', 128, 1559723623, 'html', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', NULL, '', NULL, '', '', '', '', '', '', '', 'above', '<!-- Services Section -->\n  <section class=\"page-section\" id=\"services\">\n    <div class=\"container\">\n      <h2 class=\"text-center mt-0\">At Your Service</h2>\n      <hr class=\"divider my-4\">\n      <div class=\"row\">\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-gem text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Sturdy Themes</h3>\n            <p class=\"text-muted mb-0\">Our themes are updated regularly to keep them bug free!</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-laptop-code text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Up to Date</h3>\n            <p class=\"text-muted mb-0\">All dependencies are kept current to keep things fresh.</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-globe text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Ready to Publish</h3>\n            <p class=\"text-muted mb-0\">You can use this design as is, or you can make changes!</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-heart text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Made with Love</h3>\n            <p class=\"text-muted mb-0\">Is it really open source if it\'s not made with love?</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </section>', '', NULL, NULL, '', '', '', '', '', 0, 'ascending', '', '', '', '', NULL, '', '', '', '', '', '', '', NULL, NULL, '', 4, 0, 0, '', '', '', NULL, '', NULL, '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', '', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', NULL, '', NULL, NULL, 0, 0, '', '', 'none', '', '', '', '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1', '1', '', '', '', '', '', '1', '', '', '', 0, '', 0, 0, '0%', 0, '', '', '', '', '', '', '', '', 'rsts_default', 0, '', 0, 'rsts_default');
