(37, 3, 1559550412, 'Section Contact', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', 'html', 0, 0, '', '', '', 0, '', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', 'a:0:{}', '', '', NULL, NULL, '<!-- Contact Section -->\n  <section class=\"page-section\" id=\"contact\">\n    <div class=\"container\">\n      <div class=\"row justify-content-center\">\n        <div class=\"col-lg-8 text-center\">\n          <h2 class=\"mt-0\">Let\'s Get In Touch!</h2>\n          <hr class=\"divider my-4\">\n          <p class=\"text-muted mb-5\">Ready to start your next project with us? Give us a call or send us an email and we will get back to you as soon as possible!</p>\n        </div>\n      </div>\n      <div class=\"row\">\n        <div class=\"col-lg-4 ml-auto text-center mb-5 mb-lg-0\">\n          <i class=\"fas fa-phone fa-3x mb-3 text-muted\"></i>\n          <div>+1 (202) 555-0149</div>\n        </div>\n        <div class=\"col-lg-4 mr-auto text-center\">\n          <i class=\"fas fa-envelope fa-3x mb-3 text-muted\"></i>\n          <!-- Make sure to change the email address in anchor text AND the link below! -->\n          <a class=\"d-block\" href=\"mailto:contact@yourwebsite.com\">contact@yourwebsite.com</a>\n        </div>\n      </div>\n    </div>\n  </section>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL, NULL, '', NULL, '', '', NULL, '', 1, 'cal_month', '', 'ascending', 0, 0, 'event_full', 'cal_default', '', 'ascending', '', '', '', '', 'com_default', NULL, 0, '', '', '', '', '', '', '', 'list_default', 'info_default', NULL, 'all_items', '', 0, 'a:2:{i:0;s:4:\"date\";i:1;s:6:\"author\";}', 'news_latest', 'news_month', 0, 'order_date_desc', '', NULL, NULL, '', NULL, NULL, 'nl_simple', NULL, '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1