(41, 3, 1559550365, 'Section Services', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', 'html', 0, 0, '', '', '', 0, '', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', 'a:0:{}', '', '', NULL, NULL, '<!-- Services Section -->\n  <section class=\"page-section\" id=\"services\">\n    <div class=\"container\">\n      <h2 class=\"text-center mt-0\">At Your Service</h2>\n      <hr class=\"divider my-4\">\n      <div class=\"row\">\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-gem text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Sturdy Themes</h3>\n            <p class=\"text-muted mb-0\">Our themes are updated regularly to keep them bug free!</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-laptop-code text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Up to Date</h3>\n            <p class=\"text-muted mb-0\">All dependencies are kept current to keep things fresh.</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-globe text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Ready to Publish</h3>\n            <p class=\"text-muted mb-0\">You can use this design as is, or you can make changes!</p>\n          </div>\n        </div>\n        <div class=\"col-lg-3 col-md-6 text-center\">\n          <div class=\"mt-5\">\n            <i class=\"fas fa-4x fa-heart text-primary mb-4\"></i>\n            <h3 class=\"h4 mb-2\">Made with Love</h3>\n            <p class=\"text-muted mb-0\">Is it really open source if it\'s not made with love?</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </section>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL