(47, 3, 1559724157, 'Section Pricing &#40;Snippet&#41;', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', 'html', 0, 0, '', '', '', 0, '', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', 'a:0:{}', '', '', NULL, NULL, '<!-- This snippet uses Font Awesome 5 Free as a dependency. You can download it at fontawesome.io! -->\n<section class=\"pricing py-5\" id=\"pricing\">\n  <div class=\"container\">\n    <div class=\"row\">\n      <!-- Free Tier -->\n      <div class=\"col-lg-4\">\n        <div class=\"card mb-5 mb-lg-0\">\n          <div class=\"card-body\">\n            <h5 class=\"card-title text-muted text-uppercase text-center\">Free</h5>\n            <h6 class=\"card-price text-center\">$0<span class=\"period\">/month</span></h6>\n            <hr>\n            <ul class=\"fa-ul\">\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Single User</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>5GB Storage</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Unlimited Public Projects</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Community Access</li>\n              <li class=\"text-muted\"><span class=\"fa-li\"><i class=\"fas fa-times\"></i></span>Unlimited Private Projects</li>\n              <li class=\"text-muted\"><span class=\"fa-li\"><i class=\"fas fa-times\"></i></span>Dedicated Phone Support</li>\n              <li class=\"text-muted\"><span class=\"fa-li\"><i class=\"fas fa-times\"></i></span>Free Subdomain</li>\n              <li class=\"text-muted\"><span class=\"fa-li\"><i class=\"fas fa-times\"></i></span>Monthly Status Reports</li>\n            </ul>\n            <a href=\"#\" class=\"btn btn-block btn-primary text-uppercase\">Button</a>\n          </div>\n        </div>\n      </div>\n      <!-- Plus Tier -->\n      <div class=\"col-lg-4\">\n        <div cla