li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Community Access</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Unlimited Private Projects</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Dedicated Phone Support</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span><strong>Unlimited</strong> Free Subdomains</li>\n              <li><span class=\"fa-li\"><i class=\"fas fa-check\"></i></span>Monthly Status Reports</li>\n            </ul>\n            <a href=\"#\" class=\"btn btn-block btn-primary text-uppercase\">Button</a>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</section>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL, NULL, '', NULL, '', '', NULL, '', 1, 'cal_month', '', 'ascending', 0, 0, 'event_full', 'cal_default', '', 'ascending', '', '', '', '', 'com_default', NULL, 0, '', '', '', '', '', '', '', 'list_default', 'info_default', NULL, 'all_items', '', 0, 'a:2:{i:0;s:4:\"date\";i:1;s:6:\"author\";}', 'news_latest', 'news_month', 0, 'order_date_desc', '', NULL, NULL, '', NULL, NULL, 'nl_simple', NULL, '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1', '1', '', '', '', '', '', '1', '', '', '', 0, '', 0, 0, '0%', 0, '', '', '', '', '', '', '', '', 'rsts_default', 0, '', 0, 'rsts_default'),
