(57, 3, 1559744440, 'Section Showcase', 'a:2:{s:5:\"value\";s:0:\"\";s:4:\"unit\";s:2:\"h2\";}', 'html', 0, 0, '', '', '', 0, '', '', NULL, NULL, '', '', '', 0, '', NULL, '', 0, 'and', '', 48, 1000, 0, 'simple', '', 'main', 0, '', NULL, '', 'a:0:{}', '', '', NULL, NULL, '<!-- Showcase Snippet -->\n<section class=\"showcase\" id=\"showcase\">\n    <div class=\"container-fluid p-0\">\n      <div class=\"row no-gutters\">\n\n        <div class=\"col-lg-6 order-lg-2 text-white showcase-img\" style=\"background-image: url(\'https://blackrockdigital.github.io/startbootstrap-landing-page/img/bg-showcase-1.jpg\');\"></div>\n        <div class=\"col-lg-6 order-lg-1 my-auto showcase-text\">\n          <h2>Fully Responsive Design</h2>\n          <p class=\"lead mb-0\">When you use a theme created by Start Bootstrap, you know that the theme will look great on any device, whether it\'s a phone, tablet, or desktop the page will behave responsively!</p>\n        </div>\n      </div>\n      <div class=\"row no-gutters\">\n        <div class=\"col-lg-6 text-white showcase-img\" style=\"background-image: url(\'https://blackrockdigital.github.io/startbootstrap-landing-page/img/bg-showcase-2.jpg\');\"></div>\n        <div class=\"col-lg-6 my-auto showcase-text\">\n          <h2>Updated For Bootstrap 4</h2>\n          <p class=\"lead mb-0\">Newly improved, and full of great utility classes, Bootstrap 4 is leading the way in mobile responsive web development! All of the themes on Start Bootstrap are now using Bootstrap 4!</p>\n        </div>\n      </div>\n      <div class=\"row no-gutters\">\n        <div class=\"col-lg-6 order-lg-2 text-white showcase-img\" style=\"background-image: url(\'https://blackrockdigital.github.io/startbootstrap-landing-page/img/bg-showcase-3.jpg\');\"></div>\n        <div class=\"col-lg-6 order-lg-1 my-auto showcase-text\">\n          <h2>Easy to Use [&] Customize</h2>\n          <p class=\"lead mb-0\">Landing Page is just HTML and CSS with a splash of SCSS for users who demand some deeper customization options. Out of the box, just add your content and images, and your new landing page will be ready to go!</p>\n        </div>\n      </div>\n    </div>\n  </section>', 3600, NULL, 'rss_default', 3, '', NULL, '', '', '', '', NULL, '', 0, NULL, NULL, '', NULL, '', '', NULL, '', 1, 'cal_month', '', 'ascending', 0, 0, 'event_full', 'cal_default', '', 'ascending', '', '', '', '', 'com_default', NULL, 0, '', '', '', '', '', '', '', 'list_default', 'info_default', NULL, 'all_items', '', 0, 'a:2:{i:0;s:4:\"date\";i:1;s:6:\"author\";}', 'news_latest', 'news_month', 0, 'order_date_desc', '', NULL, NULL, '', NULL, NULL, 'nl_simple', NULL, '', '', '', '1', '', 0, 0, 0, 0, 50, 0, 0, 0, 0, '', 0, 0, 50, 50, 0, 0, 0, 0, 'a:3:{i:0;s:2:\"50\";i:1;s:2:\"50\";i:2;s:4:\"crop\";}', '1', '', '', 0, '', '1x1', '100%', '', '1', '1', '', '', '', '', '', '1', '', '', '', 0, '', 0, 0, '0%', 0, '', '', '', '', '', '', '', '', 'rsts_default', 0, '', 0, 'rsts_default'),
