(1, 1, 1495533123, 'Wie viele Kontakte gibt’s für Ihr Budget?', 'wie-viele-kontakte-gibts-fuer-ihr-budget', 1, 1495272120, 1495272120, 'Im Gesamtpaket ist alles enthalten', '<p>Bestimmen Sie Ihr Budget, Ihre gewünschte Sprachregion und los geht’s. Der Kampagnenrechner liefert Ihnen die Anzahl möglicher TV-Spots und die Info, mit welcher Zielgruppe Sie wie viele Kontakte in den SRG-Programmen generieren können. Weiterführend erfahren Sie die möglichen Programme, Sparten, Spotdauern, Ratings, GRPs und vieles mehr. Im Gesamtpaket ist alles enthalten, was Ihr Kampagnenherz begehrt.</p>', '1', 0x057de1323d3e11e7a3f240b03409e6de, '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '', '', NULL, '', NULL, ''),
(5, 1, 1495533122, 'Ihr optimales Planungstool für Ihre Kampagne', 'wie-viele-kontakte-gibts-fuer-ihr-budget-kopie', 1, 1495288920, 1495288920, 'Im Gesamtpaket ist alles enthalten', '<p>Sehen Sie sich das SRG-Programm und die jeweiligen Preise der dazugehörigen Zeitschienen an. Die Preise sind bereits ein halbes Jahr im Voraus definiert, was Ihnen eine frühzeitige Planung Ihrer Kampagne ermöglicht. Wählen Sie Ihren gewünschten Sender, Datum und Zeit. Dank der übersichtlichen Struktur sehen Sie Werbeblöcke, Unterbrecherblöcke und zusätzliche Blockausstrahlungen. Parallel zu den Preisen sehen Sie das Rating, den GRP und den CPP der Sendeformate. Exportieren Sie Ihre Informationen zum Präsentieren als PDF oder zur Weiterbearbeitung als Excel-Tabelle.</p>', '1', 0x0132e47b3d6511e7a3f240b03409e6de, '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '1', '1', '', '', '', NULL, '', NULL, ''),
(6, 1, 1495544251, 'Wie viele Kontakte gibt’s für Ihr Budget?', 'wie-viele-kontakte-gibts-fuer-ihr-budget-6', 1, 1495537080, 1495537080, 'Im Gesamtpaket ist alles enthalten', '<p>Bestimmen Sie Ihr Budget, Ihre gewünschte Sprachregion und los geht’s. Der Kampagnenrechner liefert Ihnen die Anzahl möglicher TV-Spots und die Info, mit welcher Zielgruppe Sie wie viele Kontakte in den SRG-Programmen generieren können. Weiterführend erfahren Sie die möglichen Programme, Sparten, Spotdauern, Ratings, GRPs und vieles mehr. Im Gesamtpaket ist alles enthalten, was Ihr Kampagnenherz begehrt.</p>', '1', 0x057de1323d3e11e7a3f240b03409e6de, '', 'a:3:{i:0;s:0:\"\";i:1;s:0:\"\";i:2;s:12:\"proportional\";}', 'a:5:{s:6:\"bottom\";s:0:\"\";s:4:\"left\";s:0:\"\";s:5:\"right\";s:0:\"\";s:3:\"top\";s:0:\"\";s:4:\"unit\";s:0:\"\";}', '', '', '', 'above', '', NULL, 'article', 0, 24, '', '', '', '', '1', '1', '', '', '', NULL, '', NULL, '');
